import React from "react";
import jsPDF from "jspdf";
import ResumeData from "../ResumeData";
const Resume = () => {
  // genResume = () => {
  //   var doc = new jsPDF("p", "pt");

  //   doc.text(20, 20);
  // };

  return (
    <>
      {ResumeData.map((val, index) => {
        return (
          <div key={index}>
            {/* key={index} */}
            console.log("inside resume")
            <a index={index} href={val.doc} />
          </div>
        );
      })}
    </>
  );
};

// <section id="app">
